var timerInterval = 0;

function updateTimer(){
  
	updateTimerWindow();
	if(timer.timeLeft()=="racing"){
    console.log("Start race");
    sailingWindow.show();
    sailing.racing = 1;
    clearInterval(timerInterval);
    var distance = line.distanceToStart(position);
    if(distance>=0){
      showAlert("CLEAR",distance+"m",25000);
    }   else {
      showAlert("OCS",distance+"m",250000);
      vibrate("long",10);
    } 
	}
  
}

function timerStart(){
    timer.start();
    timerInterval = setInterval(updateTimer, 1000);
  
}

function timerUp(){
  console.log("up");
  timer.up();
}
function timerDown() {
  console.log("down");
  timer.down();
}

function timerSync(){
  timer.sync();
  clearInterval(timerInterval);
  updateTimerWindow();
  timerInterval = setInterval(updateTimer, 1000);
}

function timerReset() {
  
  timer.reset();
  updateTimerWindow();
  sailing.racing = 0;
  sailing.TWD = -1;
  sailing.upwindMarks = [];
  sailing.downwindMarks = [];
}


timerWindow.on('click','select',function(){
  if(timer.started){
    timerOptions.show();
  }else{
  timerStart();
    
  }
});

timerWindow.on('click','down',function() {  timerDown();updateTimerWindow();});
timerWindow.on('click','up',function() {  timerUp();updateTimerWindow();});

timerOptions.on('click','up',function() {  
  timerSync();timerOptions.hide();vibrate("short");
});
timerOptions.on('click','down',function() {  
  timerReset();timerOptions.hide();vibrate("short");
});


