//FUNCTIONS//
//SAME AS IN LOCALHOST
var currentAlert = "";
function showAlert(title,text,timeout){
  //if alert is already displayed
  if(currentAlert!=title){
    console.log(title+" "+text+" "+timeout);
    vibrate("long",2);
    alertTitle.text(title);
    currentAlert = title;
    alertWindow.show();
    setTimeout(function(){
    alertWindow.hide();
    currentAlert = "";
  },timeout);
  }
  alertText.text(text);

  
 
 }

function vibrate(vibeType, vibeTimes){  
  if(typeof vibeTimes === 'undefined'){
    Vibe.vibrate(vibeType);
  }else{
    for(var i = 1; i<vibeTimes;i++){
      setTimeout(function(){vibrate(vibeType);},i*1000);  
    }
  }
  
}

function findAlert(){
  if(sailing.alert.title!==false){
    showAlert(sailing.alert.title,sailing.alert.text,sailing.alert.timeout);
    sailing.alert.title = false;
  }
}

function getWind(lat,lon){
  console.log("Getting wind. lat:"+lat+" lon:"+lon);
  ajax(
		{
		  url: 'http://api.openweathermap.org/data/2.5/weather?lat='+lat+'&lon='+lon+'&appid=0e67a6c1bac3d49b075c4d3dbe1757e0',
		  type: 'json'
		},
		function(data) {
      // Success!
			sailing.referenceWind = Math.round(data.wind.deg);
		  //var windSpeed = Math.round(data.wind.speed*1.9*10)/10;		 
	    console.log("Wind direction received: "+sailing.referenceWind);
      updateWindWindow();
		},
		function(error) {
      console.log('Failed fetching weather data: ' + error);
		}
	);
}




function newPosition(pos){
  position = sailing.computePosition(pos);
  updateSailingWindow();
  updateWindWindow();
  findAlert();
  if(sailing.referenceWind<-1){
    sailing.referenceWind++;
    getWind(position.lat, position.lon);
    windWindow.show();
  }

}




//GETTING GPS INFO CONTINIOUSLY
var watchID;
var geoLoc;

function errorHandler(err) {  if(err.code == 1) {  homeWindow.body("Error: Access is denied!");  }
  else if( err.code == 2) {    homeWindow.body("Error: Position is unavailable!");  } 
  else{     homeWindow.body("Error: Position is unavailable!");}}

function getLocationUpdate(){
  if(navigator.geolocation){
    var options = {enableHighAccuracy: true,  timeout: 50000,  maximumAge: 0};
    geoLoc = navigator.geolocation;
    watchID = geoLoc.watchPosition(newPosition, errorHandler, options);
    
  }  else{
    homeWindow.body("Sorry, browser does not support geolocation!");
  }
}



