function locationUpdate(){
	var pos = {
		timestamp:data[coord][0],
		coords: {
			latitude:data[coord][1],
			longitude:data[coord][2],
			speed:data[coord][3],
			heading:data[coord][4]
		}
	};
  newPosition(pos);
		
	var next = (data[coord+1][0]-data[coord][0])/10;
	coord++;
	
	setTimeout(function(){ locationUpdate(); }, next);
}


